INSERT INTO `field_revision_field_block_social_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_block_social_body_value`, `field_block_social_body_summary`, `field_block_social_body_format`) VALUES
('bean', 'block_type_social', 0, 3, 4, 'und', 0, 'GE Reports Việt Nam cung cấp tin tức đa dạng về những ý tưởng đột phá được ứng dụng trong hoạt động của GE. Ngoài ra, trang cập nhật thông tin nổi bật về những công nghệ số tiên tiến đang thúc đẩy sự phát triển của nhiều ngành công nghiệp như số hóa, năng lượng, y tế, hàng không, giao thông, phát triển bền vững... trên toàn cầu. Hãy đăng ký theo dõi để không bỏ lỡ các bản tin hữu ích từ GE Reports Việt Nam.', '', 'full_html'),
('bean', 'block_type_social', 0, 3, 5, 'und', 0, 'GE Reports Việt Nam cung cấp tin tức đa dạng về những ý tưởng đột phá được ứng dụng trong hoạt động của GE. Ngoài ra, trang cập nhật thông tin nổi bật về những công nghệ số tiên tiến đang thúc đẩy sự phát triển của nhiều ngành công nghiệp như số hóa, năng lượng, y tế, hàng không, giao thông, phát triển bền vững... trên toàn cầu. Hãy đăng ký theo dõi để không bỏ lỡ các bản tin hữu ích từ GE Reports Việt Nam.', '', 'full_html'),
('bean', 'block_type_social', 0, 3, 9, 'und', 0, '<p><img alt="" src="http://gereports.digimed.vn/wp-content/uploads/2016/09/logo-white-300x54-1-300x54.png" /></p>\r\n\r\n<p>GE Reports Việt Nam cung cấp tin tức đa dạng về những ý tưởng đột phá được ứng dụng trong hoạt động của GE. Ngoài ra, trang cập nhật thông tin nổi bật về những công nghệ số tiên tiến đang thúc đẩy sự phát triển của nhiều ngành công nghiệp như số hóa, năng lượng, y tế, hàng không, giao thông, phát triển bền vững... trên toàn cầu. Hãy đăng ký theo dõi để không bỏ lỡ các bản tin hữu ích từ GE Reports Việt Nam.</p>\r\n', '', 'full_html');
